import React, { Component } from 'react';

class Planet extends Component {
  constructor(props) {
    super(props);
    // this.state = { inhabitants: ['Attilus', 'Dennix', 'Mobius'] };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange() {
    this.props.intransitToStarShip();
  }

  render() {
    const toStarship = this.props.intransitToStarShip;
    return (
      <div className="Planet">
        <h3>Planet Earth</h3>
        {toStarship.map((name) => {
          return (
            <button key={name} onClick={this.handleChange}>
              Transport {name}
            </button>
          );
        })}
      </div>
    );
  }
}

export default Planet;
